import React, { Component, Fragment } from 'react';
import EventDashboard from '../../features/event/EventDashboard/EventDashboard';
import NavBar from '../../features/nav/NavBar/NavBar';

class App extends Component {
  render() {
    return (
      <Fragment>
        <NavBar />
        <EventDashboard />
      </Fragment>
    );
  }
}

export default App;
